// index.js 의 컴포넌트가 들어가는곳
import React from "react";
import "antd/dist/antd.css";
import { PropTypes } from "prop-types";

const NodeBird = ({ Component }) => {
  return (
    <div>
      <div>공통 메뉴</div>
      <Component />
    </div>
  );
};

NodeBird.prototype = {
  Component: PropTypes.elementType.isRequired,
};

export default NodeBird;
